description:
Marika's been holding her breath waiting for this moment, flirting games over, at last she has the chance to feel his hands on her skin. James' hesitant, tentative touches emboldened by Marika's welcome response, become urgent, demanding, pushing her beyond the brink of endurance, she dissolves into a chorus of moaning pleasure.



